g.ns42:text:
\begin{minipage}{0.7\textwidth}
\centering 
\begin{itemize}
\item Impurity projected to spin-half Hilbert space\\[20pt]
\item \textbf{Spin-exchange coupling} with conduction bath spin
\[H = H_\text{bath} + J \vec S_d \cdot \vec s\]\\
\item Ground state is a \textbf{macroscopic singlet} formed by the impurity and the conduction bath\\[20pt]
\item Charge variant involves \textbf{isospin exchange}
\end{itemize}
\end{minipage}

\begin{minipage}{0.7\textwidth}
\centering 
\begin{itemize}
\item Local impurity interacting with bath: $H_\text{bath} = \sum_{k\sigma}\epsilon_k \hat n{k\sigma}$
\item Hubbard repulsion $U$ on impurity and 1-particle hybridisation $V$ with bath
\[H = H_\text{bath} + \epsilon_d \hat n_d + U\hat n_{d \uparrow}\hat n_{d\downarrow} + V\sum_{k\sigma}\left(c^\dagger_{k\sigma} c_{d\sigma} + \text{h.c.}\right)\]
\item \textbf{Microscopic origin of local moments in metals}
\end{itemize}
\end{minipage}

\begin{minipage}{0.7\textwidth}
\centering 
\begin{itemize}
\item Add spin and isospin exchange $J$ and $K$ to SIAM\\[20pt]
\item Exchange couplings are \textbf{dynamically generated under RG}, simpler to keep them at the start\\[20pt]
\item $V$ renormalises at lowest order\\[20pt]
\item Describes \textbf{both spin and charge screening} in one model
\end{itemize}
\end{minipage}

\begin{minipage}{1.25\textwidth}
\centering 
\begin{itemize}
\item What's the \textbf{effective Hamiltonian} for the conduction electrons that screen the impurity?\\[10pt]
\item What is the \textbf{nature of the metal} responsible for this screening?\\[10pt]
\item Quantitative insight into \textbf{many-particle entanglement} at and near the fixed point\\[10pt]
\item Does the interplay of $V$, $J$ and $K$ change the phase diagram in the generalised SIAM?\\[10pt]
\item Is there any \textbf{topological quantity} that changes in the process of screening?\\[10pt]
\item Can the inclusion of $J$ lead to a local \textbf{metal-insulator transition} on the impurity?
\end{itemize}
\end{minipage}

\textcolor{white}{\begin{minipage}{0.7\textwidth}
\centering 
\begin{itemize}
\item Proceeds by \textbf{applying unitary transformations} $U_j$ on the Hamiltonian to generate RG flow $H_j$
\[ H_{j-1} = U_j H_j U_j^\dagger\]
\item $U_j$ are defined so as to \textbf{remove quantum fluctuations} of high energy $k-$states\\[15pt]
\item Continues until denominator of RG equation vanishes: fixed point\\[15pt]
\item Fixed point Hamiltonian describes \textbf{emergent theory} at low energy
\end{itemize}
\end{minipage}
}
